    internal class Bezier
    {

        public int Dimension;

        public int M;

        public Tensor1 P;

        public Bezier()
        {
        }

        public Bezier(Tensor1 P, int m, int dim)
        {
            this.P = P;
            Dimension = dim;
            M = m;
        }
    }

    static class Interpolator
    {

        public static Bezier Quadratic(IScalarFunction f, EmbeddedHyperRectangle domain)
        {

            Tensor1 y = Probe(f, domain, 3);
            Tensor1 P;
            Tensor2 M;
            switch (domain.Dimension)
            {
                case 1:
                    M = LazyLoad(ref N2Dim1, 3, n2Dim1);
                    P = M * y;
                    break;
                case 2:
                    M = LazyLoad(ref N2Dim2, 3 * 3, n2Dim2);
                    P = M * y;
                    break;
                case 3:
                    M = LazyLoad(ref N2Dim3, 3 * 3 * 3, n2Dim3);
                    P = M * y;
                    break;
                default:
                    throw new NotImplementedException();
            }
            return new Bezier(P, 3, domain.Dimension);
        }

        public static Bezier Cubic(IScalarFunction f, EmbeddedHyperRectangle domain)
        {

            Tensor1 y = Probe(f, domain, 4);
            Tensor1 P;
            Tensor2 M;
            switch (domain.Dimension)
            {
                case 1:
                    M = LazyLoad(ref N3Dim1, 4, n3Dim1);
                    P = M * y;
                    break;
                case 2:
                    M = LazyLoad(ref N3Dim2, 4 * 4, n3Dim2);
                    P = M * y;
                    break;
                case 3:
                    M = LazyLoad(ref N3Dim3, 4 * 4 * 4, n3Dim3);
                    P = M * y;
                    break;
                default:
                    throw new NotImplementedException();
            }
            return new Bezier(P, 4, domain.Dimension);
        }

        static Tensor1 Probe(IScalarFunction f, EmbeddedHyperRectangle domain, int n)
        {
            Tensor1 y = Tensor1.Zeros(Algebra.Pow(n, domain.Dimension));
            Tensor1 center = domain.Center;
            Tensor1 x = Tensor1.Zeros(domain.SpaceDimension);

            for (int j = 0; j < y.M; ++j)
            {
                int l = 1;
                for (int i = 0; i < domain.SpaceDimension; ++i)
                {
                    double delta = domain.Diameters[i] / (n - 1);
                    int k = j / l % n;
                    x[i] = center[i] - domain.Diameters[i] / 2 + k * delta;
                    if (domain.ActiveDimensions[i])
                    {
                        l *= n;
                    }
                }
                y[j] = f.Evaluate(x);
            }
            return y;
        }

